using ShineEngine;

/// <summary>
/// 游戏服运行数据(generated by shine)
/// </summary>
public class GameServerRunData:BaseData
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=BaseDataType.GameServerRun;
	
	/// <summary>
	/// 在线人数
	/// </summary>
	public int onlineNum;
	
	/// <summary>
	/// gameID
	/// </summary>
	public int id;
	
	public GameServerRunData()
	{
		_dataID=BaseDataType.GameServerRun;
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "GameServerRunData";
	}
	
	/// <summary>
	/// 读取字节流(简版)
	/// </summary>
	protected override void toReadBytesSimple(BytesReadStream stream)
	{
		this.id=stream.readInt();
		
		this.onlineNum=stream.readInt();
		
	}
	
	/// <summary>
	/// 写入字节流(简版)
	/// </summary>
	protected override void toWriteBytesSimple(BytesWriteStream stream)
	{
		stream.writeInt(this.id);
		
		stream.writeInt(this.onlineNum);
		
	}
	
	/// <summary>
	/// 复制(潜拷贝)
	/// </summary>
	protected override void toShadowCopy(BaseData data)
	{
		if(!(data is GameServerRunData))
			return;
		
		GameServerRunData mData=(GameServerRunData)data;
		
		this.id=mData.id;
		this.onlineNum=mData.onlineNum;
	}
	
	/// <summary>
	/// 复制(深拷贝)
	/// </summary>
	protected override void toCopy(BaseData data)
	{
		if(!(data is GameServerRunData))
			return;
		
		GameServerRunData mData=(GameServerRunData)data;
		
		this.id=mData.id;
		
		this.onlineNum=mData.onlineNum;
		
	}
	
	/// <summary>
	/// 是否数据一致
	/// </summary>
	protected override bool toDataEquals(BaseData data)
	{
		GameServerRunData mData=(GameServerRunData)data;
		if(this.id!=mData.id)
			return false;
		
		if(this.onlineNum!=mData.onlineNum)
			return false;
		
		return true;
	}
	
	/// <summary>
	/// 转文本输出
	/// </summary>
	protected override void toWriteDataString(DataWriter writer)
	{
		writer.writeTabs();
		writer.sb.Append("id");
		writer.sb.Append(':');
		writer.sb.Append(this.id);
		
		writer.writeEnter();
		writer.writeTabs();
		writer.sb.Append("onlineNum");
		writer.sb.Append(':');
		writer.sb.Append(this.onlineNum);
		
		writer.writeEnter();
	}
	
	/// <summary>
	/// 初始化初值
	/// </summary>
	public override void initDefault()
	{
		
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		stream.startReadObj();
		
		this.id=stream.readInt();
		
		this.onlineNum=stream.readInt();
		
		stream.endReadObj();
	}
	
	/// <summary>
	/// 写入字节流(完整版)
	/// </summary>
	protected override void toWriteBytesFull(BytesWriteStream stream)
	{
		stream.startWriteObj();
		
		stream.writeInt(this.id);
		
		stream.writeInt(this.onlineNum);
		
		stream.endWriteObj();
	}
	
	/// <summary>
	/// 回池
	/// </summary>
	protected override void toRelease(DataPool pool)
	{
		this.id=0;
		this.onlineNum=0;
	}
	
}
